import React from 'react'
import Contacts from '../Contacts'

import { connect } from 'react-redux'

const mapDispatchToProps = dispatch => {
  const setCoords = event => dispatch({ type: 'set_coords', payload: event })

  return {
    setCoords,
  }
}

const ContanctsContainer = () => {
  return <Contacts />
}

export default connect(null, mapDispatchToProps)(ContanctsContainer)
